fitting:
  error evaluation: absolute
  loss model: leastsq
  lower frequency: 0.0
  upper frequency: 1.0e+30
func:
  defs:
  - CPE = 1
  expr: Rs + 1/(1/Rp + ((1j*2*3.14159*f)**p)*Tcpe)
general:
  directory name: result1
  file types: FRA5095
  result path: ./results
params:
- initial: 1.0
  max: 100.0
  min: 0.0
  name: Rs
  unit: Ω
- initial: 75000.0
  max: 80000.0
  min: 5000.0
  name: Rp
  unit: Ω
- initial: 1.76e-09
  max: 2.0e-08
  min: 0.0
  name: Tcpe
  unit: Fs^(p-1)
- initial: 0.97
  max: 1.0
  min: 0.0
  name: p
